    <React.Fragment>
      <section className={classes.summary}>
        <h2>Its food mate</h2>
        <p>Its food mate, choose the ones that make you drool</p>
        <p>The food slaps harder than my uncler's belt</p>
      </section>
    </React.Fragment>
  );
};

export default MealsSummary;
